// src/App.js
import React, { useState, useEffect } from 'react';
import TaskList from './TaskList';

const App = () => {
  const [tasks, setTasks] = useState([]);

  useEffect(() => {
    // Replace this with actual API request to fetch tasks
    // For example, you can use Axios to fetch data from your Django API.
    // For simplicity, we'll use a static array here.
    const fakeApiData = [
      { id: 1, title: 'Task 1', description: 'Description for Task 1', priority: 'High' },
      { id: 2, title: 'Task 2', description: 'Description for Task 2', priority: 'Medium' },
      // Add more tasks here
    ];

    setTasks(fakeApiData);
  }, []);

  return (
    <div className="App">
      <TaskList tasks={tasks} />
    </div>
  );
};

export default App;
